import { Component } from "react";
import "./App.css";
import logo_white from "./logo/logo_white.png";

class App extends Component {
  render() {
    const back = {
      backgroundColor: "grey",
    };
    return (
      <div className="App">
        <header className="Nav">
          <img src={logo_white} />
        </header>
        <body>
          <div style={back}>
            <h3>hi</h3>
          </div>
        </body>
      </div>
    );
  }
}

export default App;
